import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import SecurityBanner from '../components/Banner/SecurityBanner';
import SupportItem from '../components/Process/SupportItem';
import HowDevOpsWorks from '../components/Process/ServiceSubscribe';
import CloudService from '../components/Process/CloudService';
import TrackingProduct from '../components/Process/TrackingProduct';
import PaymentTestimonial from '../components/Process/PaymentTestimonial';

const Prismaprocess = () => {
    return(
        <div className="body_wrapper">

            <OnepageMenu 
                    menu_txt1= "menu_txt1" 
                    menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" 
                    menu_txt6= "menu_txt6" menu_logo= "menu_logo" /> 
            <SecurityBanner />
            <SupportItem/>
            <HowDevOpsWorks/>
            <CloudService/>
            <TrackingProduct/>
        </div>
    )
}
export default Prismaprocess;
